    "contracts/libraries/DataTypes.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

/// @title DataTypes
/// @notice This library contains the different data types for the Crafting system.
library DataTypes {

    /// @notice Enum to store the steps in the Crafting process.
    enum Step {
        CREATION,
        STYLING,
        ASSEMBLY
    }

    /// @notice Enum to store the two types of NFTs available in the Crafting.
    enum NftType {
        ARMOR,
        WEAPON
    }

    /// @notice Enum to store the different Elements.
    enum Elements {
        BULLET,
        LASER,
        METAL,
        POLYVALENT
    }

    /// @notice Enum to store the data for the Rarities.
    enum Rarity {
        COMMON,
        UNCOMMON,
        RARE,
        EPIC,
        LEGENDARY,
        NO_RARITY
    }

    /// @notice Enum to store the different Weapon Pieces.
    enum WeaponPieces {
        HILT,
        CROSS_GUARD,
        BLADE,
        HEAD,
        GRIP,
        BARREL,
        BODY,
        MAGAZINE,
        REFLEX_SIGHT,
        HOLOGRAPHIC_SIGHT,
        LASER_POINTER,
        SILENCER,
        STOCK,
        X4_SIGHT,
        BAYONETTA,
        STRIKER,
        BIPOD,
        GRENADE_LAUNCHER,
        ATTACHED_SHOTGUN,
        SNIPER_SIGHT,
        BARREL_BRAKE
    }

    /// @notice Struct to store the types for the Weapon Pieces.
    enum WeaponPieceTypes {
        MAIN,
        SIGHT,
        UNDER_BARREL,
        ACCESSORY
    }

    /// @notice Enum to store the different Weapon Types.
    enum WeaponTypes {
        KNIFE,
        BLADE,
        BLUNT,
        PISTOL,
        REVOLVER,
        SHOTGUN,
        REPEATER_SHOTGUN,
        ASSAULT_SMG,
        HIGH_RATE_SMG,
        LIGHT_MACHINE_GUN,
        ASSAULT_RIFLE,
        SNIPER_RIFLE,
        PRECISION_RIFLE
    }

    /// @notice Enum to store the different Armor Pieces.
    enum ArmorPieces {
        HELMET, 
        CHEST,
        SHOULDERS,
        FOREARMS,
        ARMS,
        GLOVES,
        LEGS,
        KNEEPADS,
        BOOTS
    }
}
"
