    "contracts/libraries/SharedStructs.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import { DataTypes } from "./DataTypes.sol";

/// @title SharedStructs
/// @notice This library contains the different shared structs for the Crafting system.
library SharedStructs {

    struct RequestData {
        uint256 tokenId;
        uint8 tier;
    }

    struct RangesByTier {
        uint16 minRange;
        uint16 maxRange;
    }

    struct ArmorTierConfig {
        address armorAddress;
        uint8 armorQuantity;
        uint8 armorTierId;
        uint8 armorRarityId;
        string armorRarityName;
        uint8 collectionId;
        string collectionName;
    }

    struct WeaponTierConfig {
        address weaponAddress;
        uint8 weaponQuantity;
        uint8 weaponTierId;
        uint8 weaponRarityId;
        string weaponRarityName;
        uint8 collectionId;
        string collectionName;
    }

    struct ItemInfo {
        uint8 tier;
        uint8 rarityId;
        string rarityName;
        uint8 collectionId;
        string collectionName;
        address firstOwner;
        uint8 piece;
    }

    /// @notice Struct to store the data for the Resources.
    struct Resource {
        address resourceAddress;
        uint256 amount;
    }

    /// @notice Struct to store the Weapon Piece information. 
    struct WeaponPieceInfo {
        uint8 numAesthetics; 
        DataTypes.WeaponPieceTypes weaponPieceType;
        mapping(uint8 => DataTypes.Elements[]) aestheticsInfo; // Aesthetic ID => Element ID[]
    }

    /// @notice Struct to store the Weapon information.
    struct WeaponInfo {
        string description;      
        DataTypes.WeaponPieces[] weaponPieces;
        mapping(uint8 => mapping(DataTypes.Step => CraftingInfo)) craftingInfo; // Tier => Step => CraftingInfo
    }

    /// @notice Struct to store the Armor Piece information. 
    struct ArmorPieceInfo {
        string description;
        uint8 numAesthetics; 
        mapping(uint8 => mapping(DataTypes.Step => CraftingInfo)) craftingInfo; // Tier => Step => CraftingInfo
    }

    /// @notice Struct to store the Crafting information (Tier/Step dependent data).
    struct CraftingInfo {
        uint64 craftingTime;
        uint256 skipTimePrice;
        Resource[] resources;
    }

    /// @notice Struct to store the information of the crafting items (Armor pieces and Weapons).
    struct CraftingItem {
        DataTypes.NftType nftType;
        uint8 itemId;
        uint8 tier;
        DataTypes.Elements element;
        uint8 rarityBooster;
        DataTypes.Rarity rarity;
        address owner;
        uint256 tokenId;
        uint8[] aesthetics;
    }

    // @notice Struct to store the information needed for the Chainlink fallback.
    struct CraftingRequestData {
        uint256 craftingId;
        uint8 tier;
        uint8 rarityBoosterId;
    }
}
"
    },
    "contracts/storage/controllers/ArmorsController.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlEnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";

import "../interfaces/IArmorsController.sol";
import { SharedStructs } from "../../libraries/SharedStructs.sol";

import "hardhat/console.sol";

/// @title WeaponsController contract 
/// @author Urriza
/// @notice A contract for managing the information regarding the Armor NFTs in the Crafting system.
/// @dev Inherits from Initializable, AccessControlEnumerableUpgradeable and PausableUpgradeable for upgradeability, 
/// access control and pausable features. It also implements the IArmorsController interface.
contract ArmorsController is 
    Initializable,
    AccessControlEnumerableUpgradeable,
    PausableUpgradeable,
    IArmorsController
{
    // ============== CONSTANTS ==============

    /// @notice The role identifier for the manager who can change the Armor Pieces information.
    bytes32 public constant MANAGER_ROLE = keccak256("MANAGER_ROLE");

    /// @notice Constant to store a role identifier for the pauser.
    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");

    // ============== VARIABLES ==============

    /// @notice Variable for knowing if contract has been initialized. 
    bool public initialized;

    /// @notice Variable to store the armor piece contract address.
    address public armorPieceAddress;

    /// @notice Mapping to store the Armor Pieces crafting information.
    mapping(DataTypes.ArmorPieces => SharedStructs.ArmorPieceInfo) private _armorPiecesInfo;

    /// @notice Storage gap for possible new variables.
    uint256[48] __gapArmorsController;

    // ============== MODIFIERS ==============

    /// @notice Modifier that will return true only when contract is initialized.
    modifier isInitialized() {
        if (!initialized) revert ContractNotInitialized();
        _;
    }

    //============== CONSTRUCTOR ==============

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    // ============== INITIALIZE ==============

    /// @notice Initializes the ArmorsController contract, setting up the access control and the ArmorERC721 contract address.
    /// @dev Grants the deployer the default admin role, manager and pauser roles.
    /// @param _armorPieceAddress The ArmorERC721 contract address.
    function initialize(
        address _armorPieceAddress
    ) 
        external 
        initializer 
    {
        if (address(_armorPieceAddress) == address(0)) revert ArmorPieceZeroAddress();
        armorPieceAddress = _armorPieceAddress;

        __AccessControlEnumerable_init();
        __Pausable_init();

        initialized = true;

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    // ============== EXTERNAL FUNCTIONS ==============

    /// @inheritdoc IArmorsController
    /*function pause() external onlyRole(PAUSER_ROLE) {
        _pause();
    }

    /// @inheritdoc IArmorsController
    function unpause() external onlyRole(PAUSER_ROLE) {
        _unpause();
    }*/

    /// @inheritdoc IArmorsController
    function setArmorPieceDescription(
        DataTypes.ArmorPieces id,
        string calldata description
    ) 
        external
        isInitialized         
        onlyRole(MANAGER_ROLE) 
    {
        _armorPiecesInfo[id].description = description;

        emit ArmorPieceDescriptionChanged(msg.sender, id, description);
    }  

    /// @inheritdoc IArmorsController
    function setArmorPiecesDescription(
        DataTypes.ArmorPieces[] calldata ids,
        string[] calldata descriptions
    ) 
        external 
        isInitialized        
        onlyRole(MANAGER_ROLE) 
    {
        uint256 numArmorPieces = ids.length;
        for (uint256 i; i < numArmorPieces;) {
            DataTypes.ArmorPieces armorPieceId = ids[i];

            _armorPiecesInfo[armorPieceId].description = descriptions[uint256(armorPieceId)];

            emit ArmorPieceDescriptionChanged(msg.sender, armorPieceId, descriptions[uint256(armorPieceId)]);

            unchecked {
                ++i;
            }
        }
    } 

    /// @inheritdoc IArmorsController
    function getArmorPieceDescription(
        DataTypes.ArmorPieces armorPieceId         
    ) 
        external 
        isInitialized
        view returns (string memory) 
    {
        return _armorPiecesInfo[armorPieceId].description;
    }

    /// @inheritdoc IArmorsController
    function setArmorPieceAesthetics(
        DataTypes.ArmorPieces id,
        uint8 numAesthetics
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        _armorPiecesInfo[id].numAesthetics = numAesthetics;

        emit ArmorPieceAestheticsChanged(msg.sender, id, numAesthetics);
    } 

    /// @inheritdoc IArmorsController
    function setArmorPiecesAesthetics(
        DataTypes.ArmorPieces[] calldata ids,
        uint8[] calldata numAesthetics
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        uint256 numArmorPieces = ids.length;
        for (uint256 i; i < numArmorPieces;) {
            DataTypes.ArmorPieces armorPieceId = ids[i];

            _armorPiecesInfo[armorPieceId].numAesthetics = numAesthetics[uint256(armorPieceId)];

            emit ArmorPieceAestheticsChanged(msg.sender, armorPieceId, numAesthetics[uint256(armorPieceId)]);

            unchecked {
                ++i;
            }
        }
    } 

    /// @inheritdoc IArmorsController
    function getArmorPieceAesthetics(
        DataTypes.ArmorPieces armorPieceId         
    ) 
        external 
        isInitialized
        view returns (uint8) 
    {
        return _armorPiecesInfo[armorPieceId].numAesthetics;
    } 

    /// @inheritdoc IArmorsController
    function setArmorPieceResources(
        DataTypes.ArmorPieces id,
        uint8 tier,
        DataTypes.Step step,
        SharedStructs.Resource[] calldata resources
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        SharedStructs.Resource[] storage resourcesStored = _armorPiecesInfo[id].craftingInfo[tier][step].resources;

        if(resourcesStored.length > 0){
            delete _armorPiecesInfo[id].craftingInfo[tier][step].resources;
        }

        uint256 numResources = resources.length;
        for (uint256 i = 0; i < numResources;) {
            resourcesStored.push(resources[i]);
            unchecked {
                ++i;
            }
        }

        emit ArmorPieceResourcesChanged(msg.sender, id, tier, step);
    }    

    /// @inheritdoc IArmorsController
    function setArmorPieceAllStepsResources(
        DataTypes.ArmorPieces id,
        uint8 tier,
        DataTypes.Step[] calldata steps,
        SharedStructs.Resource[][] calldata resources
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        uint256 numSteps = steps.length;
        for (uint256 i; i < numSteps;) {
            DataTypes.Step stepId = steps[i];

            SharedStructs.Resource[] storage resourcesStored = _armorPiecesInfo[id].craftingInfo[tier][stepId].resources;

            if(resourcesStored.length > 0){
                delete _armorPiecesInfo[id].craftingInfo[tier][stepId].resources;
            }

            uint256 numResources = resources[uint256(stepId)].length;
            for (uint256 j; j < numResources;) {
                resourcesStored.push(resources[uint256(stepId)][j]);
                unchecked {
                    ++j;
                }
            }

            emit ArmorPieceResourcesChanged(msg.sender, id, tier, stepId);

            unchecked {
                ++i;
            }
        }
    } 

    /// @inheritdoc IArmorsController
    function setArmorPieceCraftingTime(
        DataTypes.ArmorPieces id,
        uint8 tier,
        DataTypes.Step step,        
        uint64 time
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        _armorPiecesInfo[id].craftingInfo[tier][step].craftingTime = time;

        emit ArmorPieceCraftingTimeChanged(msg.sender, id, tier, step, time);
    }  

    /// @inheritdoc IArmorsController
    function setArmorPiecesCraftingTime(
        DataTypes.ArmorPieces[] calldata ids,
        uint8 tier,
        DataTypes.Step step,        
        uint64 time
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        uint256 numArmorPieces = ids.length;
        for (uint256 i; i < numArmorPieces;) {
            DataTypes.ArmorPieces armorPieceId = ids[i];

            _armorPiecesInfo[armorPieceId].craftingInfo[tier][step].craftingTime = time;

            emit ArmorPieceCraftingTimeChanged(msg.sender, armorPieceId, tier, step, time);

            unchecked {
                ++i;
            }
        }
    }  

    /// @inheritdoc IArmorsController
    function setArmorPiecesAllTiersCraftingTime(
        DataTypes.ArmorPieces[] calldata ids,         
        uint8[] calldata tiers,
        DataTypes.Step[] calldata steps,          
        uint64[] calldata times
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        uint256 numArmorPieces = ids.length;
        uint256 numTiers = tiers.length;
        //uint256 numSteps = steps.length;
        for (uint256 i; i < numArmorPieces;) {
            DataTypes.ArmorPieces armorPieceId = ids[i];

            for (uint256 j; j < numTiers;) {
                uint8 tierId = tiers[j];

                for (uint256 k; k < steps.length;) {
                    DataTypes.Step stepId = steps[k];

                    _armorPiecesInfo[armorPieceId].craftingInfo[tierId][stepId].craftingTime = times[uint256(tierId)];

                    emit ArmorPieceCraftingTimeChanged(msg.sender, armorPieceId, tierId, stepId, times[uint256(tierId)]);

                    unchecked {
                        ++k;
                    }
                }

                unchecked {
                    ++j;
                }
            }

            unchecked {
                ++i;
            }
        }
    }  

    /// @inheritdoc IArmorsController
    function getArmorPieceCraftingTime(
        DataTypes.ArmorPieces armorPieceId,
        uint8 tier,
        DataTypes.Step step          
    ) 
        external 
        isInitialized
        view returns (uint64) 
    {
        return _armorPiecesInfo[armorPieceId].craftingInfo[tier][step].craftingTime;
    } 

    /// @inheritdoc IArmorsController
    function setArmorPieceSkipTimePrice(
        DataTypes.ArmorPieces id,
        uint8 tier,
        DataTypes.Step step,             
        uint256 price
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        _armorPiecesInfo[id].craftingInfo[tier][step].skipTimePrice = price;

        emit ArmorPieceSkipTimePriceChanged(msg.sender, id, tier, step, price);
    }   

    /// @inheritdoc IArmorsController
    function setArmorPiecesSkipTimePrice(
        DataTypes.ArmorPieces[] calldata ids,
        uint8 tier,
        DataTypes.Step step,             
        uint256 price
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        uint256 numArmorPieces = ids.length;
        for (uint256 i; i < numArmorPieces;) {
            DataTypes.ArmorPieces armorPieceId = ids[i];

            _armorPiecesInfo[armorPieceId].craftingInfo[tier][step].skipTimePrice = price;

            emit ArmorPieceSkipTimePriceChanged(msg.sender, armorPieceId, tier, step, price);

            unchecked {
                ++i;
            }
        }
    }   

    /// @inheritdoc IArmorsController
    function setArmorPiecesAllTiersSkipTimePrice(
        DataTypes.ArmorPieces[] calldata ids,
        uint8[] calldata tiers,
        DataTypes.Step[] calldata steps,           
        uint256[] calldata prices
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        uint256 numArmorPieces = ids.length;
        uint256 numTiers = tiers.length;
        //uint256 numSteps = steps.length;
        for (uint256 i; i < numArmorPieces;) {
            DataTypes.ArmorPieces armorPieceId = ids[i];

            for (uint256 j; j < numTiers;) {
                uint8 tierId = tiers[j];

                for (uint256 k; k < steps.length;) {
                    DataTypes.Step stepId = steps[k];

                    _armorPiecesInfo[armorPieceId].craftingInfo[tierId][stepId].skipTimePrice = prices[uint256(tierId)];

                    emit ArmorPieceSkipTimePriceChanged(msg.sender, armorPieceId, tierId, stepId, prices[uint256(tierId)]);

                    unchecked {
                        ++k;
                    }
                }

                unchecked {
                    ++j;
                }
            }

            unchecked {
                ++i;
            }
        }
    }   

    /// @inheritdoc IArmorsController
    function getArmorPieceSkipTimePrice(
        DataTypes.ArmorPieces armorPieceId,
        uint8 tier,
        DataTypes.Step step          
    ) 
        external 
        isInitialized
        view returns (uint256) 
    {
        return _armorPiecesInfo[armorPieceId].craftingInfo[tier][step].skipTimePrice;
    } 

    /// @inheritdoc IArmorsController
    function setArmorPieceAddress(
        address _armorPieceAddress
    ) 
        external 
        isInitialized
        onlyRole(MANAGER_ROLE) 
    {
        if (_armorPieceAddress == address(0)) revert ArmorPieceZeroAddress();
        armorPieceAddress = _armorPieceAddress;

        emit ArmorPieceAddressChanged(msg.sender, _armorPieceAddress);
    }    

    /// @inheritdoc IArmorsController
    function getArmorPieceInfo(
        DataTypes.ArmorPieces armorPieceId,
        uint8 tier,
        DataTypes.Step step            
    )  
        external 
        isInitialized
        view returns (SharedStructs.CraftingInfo memory) 
    {
        return _armorPiecesInfo[armorPieceId].craftingInfo[tier][step];
    } 
}"
